(38, 2048, 1065, 'Поставляется на заказ, доставка 2-3 дня, включена в цену.\nДиски Rays Volk CV-Europe, диаметр 17, cверловка 5*114.3/4*114.3, ширина 8/9, вылет 35/40, ЦО 73мм вес 10 \nВозможна отправка по России, в Казахстан, Беларусь. Предоставлю дополнительные фотографии.'),
(38, 2048, 1071, '`("[+ATTR=77+]"=="0")?("Оригинальные [+ATTR=70+]"):(("[+INTER=129+]"=="")?("[+VAR=нск_словцо;ITEM=RAND+] [+ATTR=70+]"):("[+INTER=129;ITEM=RAND+] [+ATTR=70+]"))` R[+ATTR=9+] [+ATTR=5+] [+ATTR=31+]\nРаботаем по всей стране.\n`("[+ATTR=77+]"=="0")?("Оригинальные [+ATTR=70+]"):(("[+INTER=129+]"=="")?("[+VAR=нск_словцо;ITEM=RAND+] [+ATTR=70+]"):("[+INTER=129;ITEM=RAND+] [+ATTR=70+]"))`, с Японского аукциона.\nПараметры: сверловка - [+ATTR=5+] ширина - [+ATTR=31+] вылет - [+ATTR=32+] д.ц.о. - [+ATTR=33+]\n(Торг уместен)\n\nБольшой выбор шин и дисков в Новосибирске в наличии и под заказ, отправка в регионы.'),
(38, 2048, 1073, '[+INTER=2+]\nПоставка [+INTER=83+] дней после полной оплаты в нашем представительстве в г. [+ATTR=38+].\nДиски не гнутые, состояние на фото.\n[+VAR=avito_s;ITEM=RAND+]'),
(38, 2048, 1081, '`("[+ATTR=27+]"=="[+ATTR=38+]")?(""):("Диски находятся в г.[+ATTR=27+]. В цену включена доставка до [+LIST=10+].")`\n[+LIST=18+] Параметры ниже. [+LIST=31+] без погнутостей и трещин, не вареные, внешний вид смотрите на фото. Предоставлю дополнительные фотографии. Продаются без шин, могу укомплектовать шинами за отдельную плату. Обмен не предлагать. При необходимости могу отправить в любой город.\n\n[+VAR=disc_params+] \n\nБолее трех лет работы, масса положительных отзывов на нашем сайте.'),
